INSERT INTO `evalscript` VALUES (1,1951,'Simplistic true color image from red, green and blue bands..','//VERSION=3\r\nfunction setup(){\r\n  return{\r\n    input: [\"B02\", \"B03\", \"B04\", \"dataMask\"],\r\n    output: {bands: 4}\r\n  }\r\n}\r\n\r\nfunction evaluatePixel(sample){\r\n  // Set gain for visualisation\r\n  let gain = 2.5;\r\n  // Return RGB\r\n  return [sample.B04 * gain, sample.B03 * gain, sample.B02 * gain, sample.dataMask];\r\n}','True color',_binary ''),(2,1951,'Landsat 8 true color composite uses visible light bands red (B04), green (B03) and blue (B02) in the corresponding red, green and blue color channels, resulting in a natural colored product.','//VERSION=3\r\n\r\nlet minVal = 0.0;\r\nlet maxVal = 0.4;\r\n\r\nlet viz = new DefaultVisualizer(minVal, maxVal);\r\n\r\nfunction evaluatePixel(samples) {\r\n    let val = [samples.B03, samples.B02, samples.B01];\r\n    val = viz.processList(val);\r\n    val.push(samples.dataMask);\r\n    return val;\r\n}\r\n\r\nfunction setup() {\r\n  return {\r\n    input: [{\r\n      bands: [\r\n        \"B01\",\r\n        \"B02\",\r\n        \"B03\",\r\n        \"dataMask\"\r\n      ]\r\n    }],\r\n    output: {\r\n      bands: 4\r\n    }\r\n  }\r\n}','Landsat 4-5 TM True Color',_binary ''),(3,1951,'The well known and widely used NDVI is a simple, but effective index for quantifying green vegetation. It normalizes green leaf scattering in Near Infra-red wavelengths with chlorophyll absorption in red wavelengths.','//VERSION=3\r\nfunction setup() {\r\n   return {\r\n      input: [\"B04\", \"B08\", \"dataMask\"],\r\n      output: { bands: 4 }\r\n   };\r\n}\r\n\r\nconst ramp = [\r\n   [-0.5, 0x0c0c0c],\r\n   [-0.2, 0xbfbfbf],\r\n   [-0.1, 0xdbdbdb],\r\n   [0, 0xeaeaea],\r\n   [0.025, 0xfff9cc],\r\n   [0.05, 0xede8b5],\r\n   [0.075, 0xddd89b],\r\n   [0.1, 0xccc682],\r\n   [0.125, 0xbcb76b],\r\n   [0.15, 0xafc160],\r\n   [0.175, 0xa3cc59],\r\n   [0.2, 0x91bf51],\r\n   [0.25, 0x7fb247],\r\n   [0.3, 0x70a33f],\r\n   [0.35, 0x609635],\r\n   [0.4, 0x4f892d],\r\n   [0.45, 0x3f7c23],\r\n   [0.5, 0x306d1c],\r\n   [0.55, 0x216011],\r\n   [0.6, 0x0f540a],\r\n   [1, 0x004400],\r\n];\r\n\r\nconst visualizer = new ColorRampVisualizer(ramp);\r\n\r\nfunction evaluatePixel(samples) {\r\n   let ndvi = index(samples.B08, samples.B04);\r\n   let imgVals = visualizer.process(ndvi);\r\n   return imgVals.concat(samples.dataMask)\r\n}','Normalized difference vegetation index',_binary ''),(4,1951,'Bands used to calculate NDVI index: B4, B8 Bands used by the script: B2, B3, B4, B8','function clamp (a) {\r\n  return a<0 ? 0 : a > 1 ? 1 : a;\r\n}\r\nfunction sigNDVI (b4, s4, b8, s8) {\r\n  var sum = b8 + b4;\r\n  var ndvi = (b8 - b4)/sum;\r\n  var s_ndvi = 2 / (sum*sum) *\r\n      Math.sqrt(b8*b8*s4*s4+b4*b4*s8*s8);\r\n  var darkness = clamp(1-2*s_ndvi);\r\n  return [\r\n    0.9*clamp(1-ndvi)*darkness,\r\n    0.8*clamp(ndvi)*darkness,\r\n    0.1*darkness];\r\n}\r\nreturn sigNDVI(B04, 0.02, B08, 0.03);','Normalized difference vegetation index with uncert',_binary ''),(5,1951,'This script aims to obtain a time series within a specific time period by a single request. Usually, the number of output bands is required to be set in the evalscript when making a request; however, in case users are interested in a time-series analysis, they would like to have all (or partial if a filtering step is needed) available acquisitions whose number is not always clear before making a request.','//VERSION=3\r\n// Script to extract a time series of NDVI values using \r\n// Sentinel 2 Level 2A data and  metadata file.\r\nfunction setup() {\r\n    return {\r\n      input: [{\r\n        bands: [\"B04\", \"B08\"],\r\n        units: \"DN\"\r\n      }],\r\n      output: {\r\n        bands: 1,\r\n        sampleType: SampleType.FLOAT32\r\n      },\r\n      mosaicking: Mosaicking.ORBIT\r\n    }\r\n    \r\n  }\r\n  \r\n  // The following function is designed to update the number of\r\n  // output bands without knowing beforehand how many there are\r\n  function updateOutput(outputs, collection) {\r\n      Object.values(outputs).forEach((output) => {\r\n          output.bands = collection.scenes.length;\r\n      });\r\n  }\r\n  // function to generate a json file with a list of the NDVI \r\n  // dates used in the analysis. \r\n  function updateOutputMetadata(scenes, inputMetadata, outputMetadata) {\r\n      var dds = [];\r\n      for (i=0; i<scenes.length; i++){\r\n        dds.push(scenes[i].date)\r\n      }\r\n      outputMetadata.userData = { \"acquisition_dates\":  JSON.stringify(dds) }\r\n  }\r\n  \r\n  function evaluatePixel(samples) {\r\n    // Precompute an array to contain NDVI observations\r\n    var n_observations = samples.length;\r\n    let ndvi = new Array(n_observations).fill(0);\r\n    \r\n    // Fill the array with NDVI values\r\n    samples.forEach((sample, index) => {\r\n      ndvi[index] = (sample.B08 - sample.B04) / (sample.B08 + sample.B04) ;\r\n    });\r\n                       \r\n    return ndvi;\r\n  }','Normalized difference vegetation index time series',_binary ''),(6,1951,'The Fraction of Vegetation Cover (FCover) corresponds to the fraction of ground covered by green vegetation. Practically, it quantifies the spatial extent of the vegetation. Because it is independent from the illumination direction and it is sensitive to the vegetation amount, FCover is a very good candidate for the replacement of classical vegetation indices for the monitoring of ecosystems.  Note that the FCOVER script is as implemented in SNAP but without input and output validation! Input/ou','//VERSION=3\r\n\r\n\r\nfunction setup() {\r\n  return {\r\n    input: [{\r\n      bands: [\r\n        \"B03\",\r\n        \"B04\",\r\n        \"B05\",\r\n        \"B06\",\r\n        \"B07\",\r\n        \"B8A\",\r\n        \"B11\",\r\n        \"B12\",\r\n        \"viewZenithMean\",\r\n        \"viewAzimuthMean\",\r\n        \"sunZenithAngles\",\r\n        \"sunAzimuthAngles\"\r\n      ]\r\n    }],\r\n    output: [\r\n        {\r\n          id: \"default\",\r\n          sampleType: \"AUTO\",\r\n          bands: 1\r\n        }\r\n    ]\r\n  }\r\n}\r\n\r\nvar degToRad = Math.PI / 180;\r\n\r\nfunction evaluatePixel(sample) {\r\n  var b03_norm = normalize(sample.B03, 0, 0.253061520472);\r\n  var b04_norm = normalize(sample.B04, 0, 0.290393577911);\r\n  var b05_norm = normalize(sample.B05, 0, 0.305398915249);\r\n  var b06_norm = normalize(sample.B06, 0.00663797254225, 0.608900395798);\r\n  var b07_norm = normalize(sample.B07, 0.0139727270189, 0.753827384323);\r\n  var b8a_norm = normalize(sample.B8A, 0.0266901380821, 0.782011770669);\r\n  var b11_norm = normalize(sample.B11, 0.0163880741923, 0.493761397883);\r\n  var b12_norm = normalize(sample.B12, 0, 0.49302598446);\r\n  var viewZen_norm = normalize(Math.cos(sample.viewZenithMean * degToRad), 0.918595400582, 0.999999999991);\r\n  var sunZen_norm  = normalize(Math.cos(sample.sunZenithAngles * degToRad), 0.342022871159, 0.936206429175);\r\n  var relAzim_norm = Math.cos((sample.sunAzimuthAngles - sample.viewAzimuthMean) * degToRad)\r\n\r\n  var n1 = neuron1(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm);\r\n  var n2 = neuron2(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm);\r\n  var n3 = neuron3(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm);\r\n  var n4 = neuron4(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm);\r\n  var n5 = neuron5(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm);\r\n\r\n  var l2 = layer2(n1, n2, n3, n4, n5);\r\n\r\n  var fcover = denormalize(l2, 0.000181230723879, 0.999638214715);\r\n\r\n  return {default: [fcover]}\r\n}\r\n\r\nfunction neuron1(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm) {\r\n  var sum =\r\n	- 1.45261652206\r\n	- 0.156854264841 * b03_norm\r\n	+ 0.124234528462 * b04_norm\r\n	+ 0.235625516229 * b05_norm\r\n	- 1.8323910258 * b06_norm\r\n	- 0.217188969888 * b07_norm\r\n	+ 5.06933958064 * b8a_norm\r\n	- 0.887578008155 * b11_norm\r\n	- 1.0808468167 * b12_norm\r\n	- 0.0323167041864 * viewZen_norm\r\n	- 0.224476137359 * sunZen_norm\r\n	- 0.195523962947 * relAzim_norm;\r\n\r\n  return tansig(sum);\r\n}\r\n\r\nfunction neuron2(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm) {\r\n  var sum =\r\n	- 1.70417477557\r\n	- 0.220824927842 * b03_norm\r\n	+ 1.28595395487 * b04_norm\r\n	+ 0.703139486363 * b05_norm\r\n	- 1.34481216665 * b06_norm\r\n	- 1.96881267559 * b07_norm\r\n	- 1.45444681639 * b8a_norm\r\n	+ 1.02737560043 * b11_norm\r\n	- 0.12494641532 * b12_norm\r\n	+ 0.0802762437265 * viewZen_norm\r\n	- 0.198705918577 * sunZen_norm\r\n	+ 0.108527100527 * relAzim_norm;\r\n\r\n  return tansig(sum);\r\n}\r\n\r\nfunction neuron3(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm) {\r\n  var sum =\r\n	+ 1.02168965849\r\n	- 0.409688743281 * b03_norm\r\n	+ 1.08858884766 * b04_norm\r\n	+ 0.36284522554 * b05_norm\r\n	+ 0.0369390509705 * b06_norm\r\n	- 0.348012590003 * b07_norm\r\n	- 2.0035261881 * b8a_norm\r\n	+ 0.0410357601757 * b11_norm\r\n	+ 1.22373853174 * b12_norm\r\n	+ -0.0124082778287 * viewZen_norm\r\n	- 0.282223364524 * sunZen_norm\r\n	+ 0.0994993117557 * relAzim_norm;\r\n\r\n  return tansig(sum);\r\n}\r\n\r\nfunction neuron4(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm) {\r\n  var sum =\r\n	- 0.498002810205\r\n	- 0.188970957866 * b03_norm\r\n	- 0.0358621840833 * b04_norm\r\n	+ 0.00551248528107 * b05_norm\r\n	+ 1.35391570802 * b06_norm\r\n	- 0.739689896116 * b07_norm\r\n	- 2.21719530107 * b8a_norm\r\n	+ 0.313216124198 * b11_norm\r\n	+ 1.5020168915 * b12_norm\r\n	+ 1.21530490195 * viewZen_norm\r\n	- 0.421938358618 * sunZen_norm\r\n	+ 1.48852484547 * relAzim_norm;\r\n\r\n  return tansig(sum);\r\n}\r\n\r\nfunction neuron5(b03_norm,b04_norm,b05_norm,b06_norm,b07_norm,b8a_norm,b11_norm,b12_norm, viewZen_norm,sunZen_norm,relAzim_norm) {\r\n  var sum =\r\n	- 3.88922154789\r\n	+ 2.49293993709 * b03_norm\r\n	- 4.40511331388 * b04_norm\r\n	- 1.91062012624 * b05_norm\r\n	- 0.703174115575 * b06_norm\r\n	- 0.215104721138 * b07_norm\r\n	- 0.972151494818 * b8a_norm\r\n	- 0.930752241278 * b11_norm\r\n	+ 1.2143441876 * b12_norm\r\n	- 0.521665460192 * viewZen_norm\r\n	- 0.445755955598 * sunZen_norm\r\n	+ 0.344111873777 * relAzim_norm;\r\n\r\n  return tansig(sum);\r\n}\r\n\r\nfunction layer2(neuron1, neuron2, neuron3, neuron4, neuron5) {\r\n  var sum =\r\n	- 0.0967998147811\r\n	+ 0.23080586765 * neuron1\r\n	- 0.333655484884 * neuron2\r\n	- 0.499418292325 * neuron3\r\n	+ 0.0472484396749 * neuron4\r\n	- 0.0798516540739 * neuron5;\r\n\r\n  return sum;\r\n}\r\n\r\nfunction normalize(unnormalized, min, max) {\r\n  return 2 * (unnormalized - min) / (max - min) - 1;\r\n}\r\nfunction denormalize(normalized, min, max) {\r\n  return 0.5 * (normalized + 1) * (max - min) + min;\r\n}\r\nfunction tansig(input) {\r\n  return 2 / (1 + Math.exp(-2 * input)) - 1;\r\n}','FCOVER (Fraction of green Vegetation Cover)',_binary ''),(7,1951,'Combining band 4 (red), band 8 (nir) and band 2 (blue) on RGB display, vegetation is highlighted so it’s easier to detect crops anomalies, and healthy vegetation can be seen in bright green.','/*\r\nAuthor of the script: Roberto Gagliardi\r\n*/\r\n\r\nreturn [B04*2.5,B08*2.5,B02*2.5];','Infrared Agriculture Display Script',_binary ''),(8,1951,'bbbbbb','//VERSION=3\r\nfunction setup() {\r\n   return {\r\n      input: [\"B04\", \"B08\", \"dataMask\"],\r\n      output: { bands: 4 }\r\n   };\r\n}\r\n\r\nconst ramp = [\r\n   [-0.5, 0x0c0c0c],\r\n   [-0.2, 0xbfbfbf],\r\n   [-0.1, 0xdbdbdb],\r\n   [0, 0xeaeaea],\r\n   [0.025, 0xfff9cc],\r\n   [0.05, 0xede8b5],\r\n   [0.075, 0xddd89b],\r\n   [0.1, 0xccc682],\r\n   [0.125, 0xbcb76b],\r\n   [0.15, 0xafc160],\r\n   [0.175, 0xa3cc59],\r\n   [0.2, 0x91bf51],\r\n   [0.25, 0x7fb247],\r\n   [0.3, 0x70a33f],\r\n   [0.35, 0x609635],\r\n   [0.4, 0x4f892d],\r\n   [0.45, 0x3f7c23],\r\n   [0.5, 0x306d1c],\r\n   [0.55, 0x216011],\r\n   [0.6, 0x0f540a],\r\n   [1, 0x004400],\r\n];\r\n\r\nconst visualizer = new ColorRampVisualizer(ramp);\r\n\r\nfunction evaluatePixel(samples) {\r\n   let ndvi = index(samples.B08, samples.B04);\r\n   let imgVals = visualizer.process(ndvi);\r\n   return imgVals.concat(samples.dataMask)\r\n}','Burgos evalscript',_binary ''),(9,1951,'Burgos evalscript agricultural area','//VERSION=3\r\nfunction setup() {\r\n   return {\r\n      input: [\"B04\", \"B08\", \"dataMask\"],\r\n      output: { bands: 4 }\r\n   };\r\n}\r\n\r\nconst ramp = [\r\n   [-0.5, 0x0c0c0c],\r\n   [-0.2, 0xbfbfbf],\r\n   [-0.1, 0xdbdbdb],\r\n   [0, 0xeaeaea],\r\n   [0.025, 0xfff9cc],\r\n   [0.05, 0xede8b5],\r\n   [0.075, 0xddd89b],\r\n   [0.1, 0xccc682],\r\n   [0.125, 0xbcb76b],\r\n   [0.15, 0xafc160],\r\n   [0.175, 0xa3cc59],\r\n   [0.2, 0x91bf51],\r\n   [0.25, 0x7fb247],\r\n   [0.3, 0x70a33f],\r\n   [0.35, 0x609635],\r\n   [0.4, 0x4f892d],\r\n   [0.45, 0x3f7c23],\r\n   [0.5, 0x306d1c],\r\n   [0.55, 0x216011],\r\n   [0.6, 0x0f540a],\r\n   [1, 0x004400],\r\n];\r\n\r\nconst visualizer = new ColorRampVisualizer(ramp);\r\n\r\nfunction evaluatePixel(samples) {\r\n   let ndvi = index(samples.B08, samples.B04);\r\n   let imgVals = visualizer.process(ndvi);\r\n   return imgVals.concat(samples.dataMask)\r\n}','Burgos evalscript 2',_binary '');
